let input = `




`;

let prev;
let inputArr = input.replace(/\s/g, '').split('');
for (let i = 0; i < inputArr.length; i++) {
    let char = inputArr[i];
    let next = inputArr[i+1];
    if (next && char && char !== next && (
        char === next.toUpperCase() || 
        char === next.toLowerCase() || 
        char.toLowerCase() === next ||
        char.toUpperCase() === next)
    ) {
        inputArr.splice(i, 2);
        i-=2;
    }
}
